import image from '../assets/ecommerce-gd190ac368_1920.jpg';
import '../App.css';
import Products from './Products';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';

function Home() {

    return (
        <>
            <div className='image'>
                <img src={image} className='home-image'></img>
            </div>
            <div class='filtering'>
                <ButtonGroup variant="outlined" aria-label="outlined primary button group" size='large'>
                    <Button color='inherit' onClick={() => {}}>All</Button>
                    <Button color='inherit'>Men</Button>
                    <Button color='inherit'> Women</Button>
                    <Button color='inherit'>Jewellery</Button>
                    <Button color='inherit'>Electronics</Button>
                </ButtonGroup>
            </div>
            <Products />
        </>
    )
}

export default Home
